import React, { Component } from 'react';

class ToDoForm extends Component {
    state = {
        text: "", 
        category: ""
    }

    render() {
        return (
            <div>
                <form class="new-task-form">
                    <input type="text" name="text" placeholder="new task detail" ></input>
                </form>
            </div>
        );
    }
}

export default ToDoForm;
